import PageBanner from "../components/banner/PageBanner";
import CartTable from "../components/cart/CartTable";

const CartPage = () => {
  return (
    <>
      <PageBanner />
      <div className="container">
        <CartTable />
      </div>
    </>
  );
};

export default CartPage;
